import React, { Component } from 'react';
import './App.css';

import {instagramAPI} from './Config/insta-config';

/*
  Link to instagram page:
  https://www.instagram.com/n.y.b.clothing/?hl=en

  Link to etsy page:
  https://www.etsy.com/ca/shop/NYBclothing
*/
class App extends Component {

  constructor(props){
    super(props);

    var accessToken = '23612221.3fcb46b.348431486f3a4fb85081d5242db9ca1c';

    instagramAPI.userSelf().then(function(result) {
      console.log(result.data); // user info
      console.log(result.limit); // api limit
      console.log(result.remaining) // api request remaining
    }, function(err){
      console.log(err); // error info
    });

  }


  render(){



    return (
      <div>

        <div>
          <h3>N Y B  Clothing</h3>
        </div>

        <div className="topnav">
          <div className="dropdown">
            <button className="dropbtn">Shop
              <i className="fa fa-caret-down"></i>
            </button>
            <div className="dropdown-content">
              <a>Link 1</a>
              <a>Link 2</a>
              <a>Link 3</a>
            </div>
          </div>
          <a>Sell</a>
          <a>Inspiration</a>
          <a>About us</a>
          <a>Contact us</a>
        </div>

      </div>
    );
  }

}

export default App;
